INSERT INTO `carrera` (`id_carrera`, `nombre`, `duracion`, `descripcion`, `imagen`, `tipo`, `estado`) VALUES
(1, 'Prepa Abierta', 18, 'Es una opción no escolarizada para acreditar el bachillerato para estudiantes con secundaria terminada, no tiene lí­mite de edad. Consta de 33 materias, las cuales deben ser acreditadas; no hay limite de oportunidades para acreditar algún examen.', 'data:image/png;filename=33.png;base64,', NULL, 1);
INSERT INTO `carrera` (`id_carrera`, `nombre`, `duracion`, `descripcion`, `imagen`, `tipo`, `estado`) VALUES
(2, 'CENEVAL', 4, 'Es un examen único de competencias equivalentes al bachillerato, está dedicado para personas mayores de 21 años que cuenten con su certificado de secundaria y hayan adquirido los conocimientos equivalentes al bachillerato por medio de su experiencia laboral.', 'data:image/png;filename=33.png;base64,', NULL, 1);
INSERT INTO `carrera` (`id_carrera`, `nombre`, `duracion`, `descripcion`, `imagen`, `tipo`, `estado`) VALUES
(3, 'ColBach', 4, 'es un servicio del Colegio de Bachilleres y tiene como objetivo evaluar al sustentante en siete áreas del conocimiento (examen global). Está dirigido a personas de 18 años en adelante', 'data:image/png;filename=33.png;base64,', NULL, 1);
INSERT INTO `carrera` (`id_carrera`, `nombre`, `duracion`, `descripcion`, `imagen`, `tipo`, `estado`) VALUES
(4, 'Prepa Abierta', 14, 'Preparatoria Abierta en plan modular es el nuevo sistema basado en competencias para acreditar el bachillerato', 'data:image/png;filename=33.png;base64,', 2, 1);
INSERT INTO `carrera` (`id_carrera`, `nombre`, `duracion`, `descripcion`, `imagen`, `tipo`, `estado`) VALUES
(6, 'DGETI', 6, 'Bachillerato con carrera técnica en administración', 'data:image/png;filename=33.png;base64,', 2, 1);
INSERT INTO `carrera` (`id_carrera`, `nombre`, `duracion`, `descripcion`, `imagen`, `tipo`, `estado`) VALUES
(7, 'Aprende en Casa', 6, 'Compilación de videos y actividades de aprende en casa', 'data:image/png;filename=33.png;base64,', 2, 1);
