(580, 'Karl Marx sostuvo que la historia de los sucesivos sistemas económicos de producción de la humanidad es la que determina la realidad de los seres humanos, en otras palabras, la materialidad entendida como estructura (economía) determina al pensamiento, el cual es entendido como superestructura (filosofía, religión, política). ¿Cuál es el nombre de esta teoría filosófica? ', 0, 3758),
(581, 'Los filósofos presocráticos estaban muy interesados en el origen de todas las cosas, es por esto que también se les conoce como naturalistas o cosmogónicos. ¿Cuál es el término griego que significa origen o gobierno de todas las cosas?', 0, 3758),
(582, 'Selecciona el concepto al que se refiere la siguiente definición: Es un saber universal, el cual tiene su base en la reflexión contemplativa, crítica e intelectual del ser humano; su finalidad es abarcar la totalidad del conocimiento a través de la razón, su finalidad es encontrar la verdad.', 0, 3758),
(583, 'Desde finales del siglo XIX hasta nuestros días la filosofía ha tenido una significante disparidad de enfoques, sistemas y escuelas, todo esto ha sido determinado por factores socioculturales, crisis de modelos económicos y políticos y el avance de las ciencias naturales, formales y humanas. Relaciona las corrientes de la filosofía contemporánea con la definición que les corresponde.\r\n\r\nCorrientes de la filosofía contemporánea\r\nI. Vitalismo.\r\nII. Historicismo.  \r\nIII. Fenomenología.\r\nIV. Existen', 0, 3758),
(584, 'En la Antigua Grecia los primeros filósofos y pensadores dejaron de dar respuestas mitológicas y comenzaron a buscar respuestas racionales, a este fenómeno se le conoce como: \r\n\r\n', 0, 3758),
(585, 'Selecciona la opción que contiene la disciplina filosófica que estudia al ser en cuanto ser, es decir, estudia lo existente.', 0, 3758),
(586, 'En la Modernidad hubo un gran conflicto entre dos posturas epistemológicas, la primera sostiene que el conocimiento proviene de la razón y es representada por Descartes, Malebranche, Spinoza y Leibniz; la segunda afirma que el conocimiento tiene su fuente en la experiencia y es representada por Locke, Berkeley y Hume. ¿Cuál es el nombre de estas posturas epistemológicas? ', 0, 3758),
(587, 'La retórica en Grecia era conocida como el arte de convencer a una audiencia sin importar la veracidad de los argumentos empleados. ¿Cuál es el nombre que reciben los maestros de la retórica en Grecia?  \r\n\r\n', 0, 3758),
(588, 'Durante los casi diez siglos de la Edad Media el cristianismo tuvo su mayor auge, esto significó que todo el pensamiento filosófico se centró en el problema de Dios. Selecciona a los dos grandes filósofos de la era medieval. ', 0, 3758),
(589, 'La filosofía de la Grecia Clásica tuvo tres grandes representantes: Sócrates, Platón y Aristóteles, sin embargo, sus posturas fueron muy diferentes entre ellas. Relaciona los filósofos humanistas con el método que les corresponde. \r\n\r\nFilósofos\r\nI. Sócrates.\r\nII. Platón.\r\nIII. Aristóteles. \r\n\r\nMétodo\r\nA. Precientífico\r\nB. Mayéutico\r\nC. Dialéctico \r\n\r\n', 0, 3758),
