(600, 'Selecciona el tipo de poder que corresponde a una sola persona: El Presidente de la República, quien es electo cada sexenio y quién no puede ser reelecto. Al ser electo, el Presidente de la República escoge a los miembros de su gabinete y otros puestos gubernamentales. El gabinete. Está formado por 19 secretarios de Estado, así como el procurador general de la República. El Presidente está encargado de ejecutar y llevar a cabo las leyes.\r\n\r\n', 0, 3759),
