(1022, '¿Cuál es la conclusión del siguiente texto?<br>El movimiento armado que comenzó en 1910 con la rebelión de Francisco I. Madero y terminó oficialmente en 1920 con la muerte de Venustiano Carranza, se originó como una protesta social, política y económica contra la dictadura de Porfirio Díaz y la enorme desigualdad en que estaba inmerso el país. El proyecto de revolución social murió con Madero (asesinado por Huerta) y a partir de ese momento, sin un programa concreto, distintos jefes armados reivindicaron conquistas militares y políticas, así como proyectos sociales diferentes. Fue una lucha cruenta que produjo cambios definitivos en la manera de concebir al país. Tuvo entre sus caudillos más importantes a Francisco Villa y Emiliano Zapata.<br><br>A. M. Morales, J. M. Sardiñas <i>et al.</i><em>Literatura de México e Iberoamérica</em><br><br>', 0, 3893),
