(1018, ' ¿Cuál es la forma sintética del texto?<br><br><b>Bajo algunos grados de calefacción</b><br>Está comprobado que sentir un poco de frío aumenta los niveles de grasa café en el cuerpo, un tipo de tejido adiposo que quema calorías y las reservas de grasa y ayuda a mantener estables los niveles de glucosa en la sangre. Un estudio realizado por investigadores estadounidenses mostró que reducir la temperatura de una habitación a 19 °C mientras los participantes dormían aumentó notablemente su volumen de grasa café y mejoró su sensibilidad a la insulina, en comparación con otro grupo que durmió a 24 °C.<br><p align=\"right\"><sup>Louise Atkinson. <em>Revista Selecciones Reader’s Digest</em></sup></p><br><br>', 0, 3893),
