(1067, 'Mesoamérica, un espacio cultural\r\nRossend ROVIRA MORGADO Doctorando en el Departamento de Historia de\r\nAmérica II (Antropología de América) Universidad Complutense de Madrid.\r\nMiembro del Proyecto de Investigaciones Arqueológicas La Ventilla 2006-2008\r\n(Teotihuacan)\r\nComo argumentaba ya hace algunos años, 100 para ser exactos Claude LéviStrauss, el hombre suele utilizar herramientas conceptuales para comprender y\r\nanalizar la realidad tangible que le rodea. De esta manera, la investigación de un\r\nmecanismo mental tan primario con el que aprender la realidad se convierte en un\r\nreto muy importante para el desarrollo de las ciencias sociales. Un buen ejemplo\r\npara entender la evolución conceptual entorno a un atractivo espacio cultural lo\r\nconstituye Mesoamérica. Diversas generaciones de antropólogos, arqueólogos, etnohistoriadores y sociólogos han utilizado este término para entender la amplia\r\ngama de desarrollos culturales que tuvieron lugar en buena parte de México y\r\nAmérica Central', 0, 3881),
