(1328, 'La maestra de la materia mundo contemporáneo les encargo a sus \r\nalumnos realizar una revisión sobre algunos temas de la unidad, \r\nque debían consultar en la biblioteca. El estudiante Omar tenía que \r\nhacer un recorrido de 4 kilómetros para lograr llegar a la biblioteca \r\nmunicipal, cada kilómetro lo caminaba en un tiempo de 7 minutos. \r\nAl estar ahí revisó el primer tema llamado “Conquista de Mejico”, \r\ndonde leyó que el 13 de agosto de 1521 la ciudad de México cayó \r\nen poder de los conquistadores españoles, al continuar su lectura \r\ndescubrió que Cortéz llego a Quiahhuiztla y Cempoala en unos de \r\nsus viajes, Omar se dio cuenta que su estado Veracruz había sido \r\nuno de los lugares importantes para la Conquista de México \r\ndespués de terminar de leer este último tema se marchó a su casa \r\nporque ya eran las 6:00 pm y la biblioteca debía de cerrar. Al llegar \r\na su casa Omar decidió compartir con sus padres lo que, aprendido \r\nesa tarde, al terminar de hablar su padre añadió: a la llegada de \r\nCortés el prometió ayudar a liberarlos del tributo a los mexicas a \r\ncambio de sellar una alianza militar de españoles y totonacas. Ahí \r\nempezó la insidia política de Cortés que habría de permitirle \r\ncapitanear una rebelión de pueblos sometidos que sería \r\ndeterminante para la conquista de los territorios del imperio \r\nmexicano, después de escuchar el comentario de su papá, Omar \r\nrecordó haber leído un poco sobre eso y agregó al comentario que \r\nel 16 de agosto de 1519 Cortés con el resto de los españoles y un \r\ngran contingente de aliados totonacas comenzó la marcha hacia la \r\nciudad de México-Tenochtitlan.<br><br>\r\nAl día siguiente la maestra les pidió a sus alumnos que realizaran \r\nun resumen sobre su primer tema, así como también deberían de \r\nmencionar la ruta que tomo cortes para llegar a México, después \r\nde esto la maestra explicó el siguiente tema de la materia, esta vez \r\nOmar le pidió a su amiga Laura que lo acompañara a la biblioteca \r\nacordando estar ahí a las 3:00 pm, para ello Laura debía de recorrer \r\nuna distancia de 5 kilómetros y ella caminaba a 8 minutos el \r\nkilómetro.<br><br>\r\nomar y laura se dispusieron a realizar su investigación como la \r\nmaestra lo había solicitado, Omar al encontrarse leyendo quedó\r\nanonadado al mirar que el Dominio de los Españoles había sido de \r\n1521 a 1821, así como también, encontró que la Independencia de \r\nMéxico había durado 11 años teniendo inicio el 16 de septiembre \r\nde 1810 con el grito de dolores y concluyendo con la entrada \r\ntriunfal del ejército Trigarante, además que Hidalgo usó como \r\nestandarte una imagen religiosa muy común en México. Laura por \r\nsu parte le platicó a Omar de la existencia de dos guerras \r\nmundiales, que al término de la segunda guerra existía una llamada \r\nla Guerra Fría. Ambos alumnos estuvieron reflexionando el daño \r\nque hacían estas guerras al ecosistema y recordaron que en México \r\ntenemos varios bosques y selvas que apoyan al ecosistema y \r\ncombaten el calentamiento global, además que estos lugares \r\ntienen especies en peligro de extinción. Estos lugares tienen\r\ngrandes cantidades de CO2 y H2O que apoyan para que no sólo el \r\npaís sino el mundo continúe, son como dos grandes pulmones que \r\nle dan vida al mundo.<br><br>\r\nEstando en la escuela Laura le comentó a Omar que su mamá le \r\nhabía platicado que durante el gobierno de Porfirio Díaz había \r\nexistido un movimiento ciudadano muy importante para los \r\nmexicanos. La maestra pidió a los alumnos que realizaran una lluvia \r\nde ideas para retroalimentar los temas de investigación, al término \r\nde esta actividad los alumnos salieron al jardín de la escuela a\r\nsembrar árboles y realizaron una recolección de pilas que ya no \r\nestuvieran funcionales, esto para cooperar con la sustentabilidad \r\ndel planeta.<br><br>\r\n1. ¿Cuál es el tiempo que Omar hace para poder llegar a la \r\nbiblioteca municipal? Teniendo en cuenta que la distancia \r\nes de 4 kilómetros y él hace un tiempo de 7 minutos por\r\nkilómetro', 1, 4114),
