(1391, 'Raúl Ramírez originario de la capital de Quintana Roo, tiene \r\npensado realizar un viaje a la Ciudad de México en Julio, donde \r\nrecorrerá los siguientes sitios: Palacio de Bellas de Artes, \r\nMonumento a la Revolución, Museo del Templo Mayor, Ángel de \r\nla Independencia, Museo Soumaya, Castillo de Chapultepec y por \r\núltimo el Zócalo de la Ciudad. Raúl cuenta con 5 días para poder \r\nconocer todos estos centros turísticos, así mismo con una cantidad \r\nde mil dólares, lo cual tiene que cambiar a pesos mexicanos. La \r\ndistancia que recorrerá en avión es de 1295 km (línea recta) con \r\nuna duración de 1 horas, 36 minutos el vuelo. Al llegar al \r\naeropuerto de la ciudad de México, Raúl se pudo percatar que un \r\njoven estaba robando en la tienda de souvenirs, lo cual le causó \r\ncierta incertidumbre. Posterior a ello, se dirigió al hotel que se \r\nencontraba en el centro de la ciudad, se trasladó en un Uber, el cual \r\nle cobro 130 pesos. El número de la habitación donde pasaría su \r\nestadía fue el 407 que se encontraba en el tercer piso del edificio y \r\nque además tenía vista directa al zócalo de la ciudad. El primer día \r\nRaúl visitó el museo del templo mayor, edificio religioso más \r\nimportante de Tenochtitlan, dedicado a Huitzilopochtli, Dios Solar \r\nde la guerra, y a Tláloc el Dios de la Lluvia. Pasando el medio día \r\ndisfrutó de un rico platillo en la zona Garibaldi. Por la tarde visitó el\r\nPalacio de Bellas Artes inaugurado bajo el nombre de Museo de \r\nArtes Plásticas, el 29 de noviembre de 1934, cabe destacar que fue \r\nel primer museo de arte en México, es decir, el primer recinto \r\ncultural dedicado a exhibir objetos artísticos para su \r\ncontemplación. Su construcción fue orden del entonces Presidente \r\nMexicano Porfirio Díaz al final de su mandato, con motivo de la \r\ncelebración del Centenario del inicio de la Independencia de \r\nMéxico. Al segundo día Raúl hizo la visita al monumento de la \r\nRevolución, el monumento está rematado por una doble cúpula, \r\nsostenida por cuatro arcos a una altura de 26 metros. Raúl se situó \r\na una distancia de 26 metros de la base de monumento para poder \r\ntomar una fotografía. En la visita al castillo de Chapultepec Raúl dio \r\nun paseo previo por el bosque, donde se percató que el ecosistema \r\nera completamente distinto al de su lugar de origen, contaba con \r\nlas características de un bosque templado por la diversidad de flora \r\nque cuenta, entre ellos hay 42 especies vegetales que son cedros, \r\nsequoias, álamos, palmeras, ailes, pinos, gingkos, sicomoro, \r\nliquidámbar. Llegando al castillo de Chapultepec, Raúl encontró \r\nuna frase que decía: Welcome to Chapultepec Castle. Para el día \r\nsiguiente estuvo presente en el museo Soumaya, allí pudo \r\nencontrar diferentes obras de arte de diferentes partes del mundo. \r\nGrecia, Italia, España, Inglaterra, etc. eran esos países quienes \r\ncompartieron sus obras de arte para ser expuestas en el museo. \r\n<br><br>\r\nPara cuando Raúl estuvo en el Ángel de la Independencia encontró \r\na unos jóvenes rayando una de las paredes, en la base de la \r\nestructura, lo cual le fue molesto. Regreso al hotel, se transportó \r\nen bicicleta para poder disfrutar del Paseo de Reforma y la vista de \r\nlos edificios, él viajaba a una velocidad de 20 km/hrs, y su hotel se \r\nencontraba a 4.6 km. Al llegar al hotel pudo hacer una recopilación \r\nde sus fotografías que fue capturando durante su visita a la CDMX.<br><br>\r\n¿Quién es sujeto en el relato? ', 1, 4114),
