(1408, 'Dos equipos de fútbol fueron convocados para poder escoger una selección representativa. Sumaron el equipo “A” más “B”. El equipo “A” contaba con 24 niñas y 18 niños. El entrenamiento del equipo “B” era realizado en un terreno de forma triangular con una esquina de 90°, mientras que el equipo “B” contaba con tres espacios de forma cuadrada, pentagonal y hexagonal. Los arqueros fueron\r\nanalizados para poder conocer la distancia del despeje máximo. Geométricamente hablando esa parábola forma parte de lugares geométricos. Para estudiar la distancia median del áreachica a donde caía el balón. Los jugadores formaban equipos para hacer ejercicio de pases cortos, al tomar a los jugadores como puntos de referencia formaban vértices, ángulos, diagonales y lados.<br><br>\r\n¿Cuánto era la sumatoria de ambos equipos (a + b)?', 1, 4114),
