(1416, 'Al estudiar al cuerpo humano encontramos una unidad \r\nmorfológica y funcional en los seres vivos, así también vimos que \r\npara que exista una homeostasis, los cambios químicos y biológicos \r\ndeben permanecer en perfecto funcionamiento. El cuerpo humano \r\nse relaciona entre sí para conseguir dos elementos esenciales para \r\nsu supervivencia, su estudio puede ir desde la partícula más \r\npequeña, llamada átomo, hasta los elementos fundamentales para \r\nla vida como son el agua y el oxígeno. También es importante \r\nmantener el cuerpo activo para evitar problemas de salud. Una \r\nactividad donde existe mayor quema calórica es la natación donde \r\ngracias a la brazada y patada obtenemos como resultado el \r\ndesplazamiento, y claro está que, para este tipo de acciones es \r\nnecesario aplicar fuerza para obtener la mecánica y técnica \r\nadecuada. El ser humano al formar parte del medio ambiente debe \r\ncuidar y tratar los diferentes ecosistemas, para que así el impacto \r\nambiental no sea tan agresivo.<br><br>\r\nUnidad morfológica y funcional de todo ser vivo:', 1, 4114),
