(1425, 'En la máquina del tiempo viajamos para conocer la conquista del \r\nContinente Americano. Dicho Continente lleva el nombre de la \r\npersona que fue el primero en pisar tierras americanas. Así bien, lo \r\nsiguieron los españoles quienes impusieron gobernantes para \r\npoder regir en las nuevas tierras. Ellos se encargaban de que se \r\nhiciera justicia y administraban la economía; era el jefe del ejército \r\ny debía proteger a la Iglesia católica. Sin embargo, llegó el \r\nmomento en donde el pueblo se cansó de ello y para 1810 se \r\nlevantaron en armas contra los españoles. Tiempo después vuelve \r\na suceder un acontecimiento por la inconformidad del pueblo por\r\nla forma que son gobernados, en ellos sobresalen los personajes \r\ncomo Francisco I. Madero, Emiliano Zapata, Porfirio Díaz. Para 1910 \r\ny 1911 el primer protagónico en esta guerra fue Francisco I. \r\nMadero quien apoyó al pueblo para ser libre del mal gobierno. Y en \r\nla conclusión de la guerra después de 4 etapas dentro de la historia, \r\nsurge el destierro de Victoriano Huerta y la inconformidad entre \r\nconvencionistas y constitucionalistas<br><br>\r\nPrimer hombre en llegar al continente americano:', 1, 4114),
