(1431, 'Quiero salir del país, y para ello fui a tramitar mi pasaporte, algo que tengo derecho de hacer, así como también después de los 18 años tengo derecho a ser participe en las elecciones de los gobernantes. Salgo del país porque al trabajar en PEMEX una industria de las más poderosas del continente, tuve problemas con\r\nel jefe de área, al igual cuando laboré en el sureste del país donde las empresas más grandes eran las productoras de materia prima comparado con las minas del centro y norte del país, México ha ido en decadencia comenzando con su mínimo apoyo a la educación, lo cual ha dado como resultado el aumento de la delincuencia y todo esto por el interés económico de los gobernantes con poca ética, hasta la misma democracia ha sido invadida por los intereses políticos.\r\nLa petición del pasaporte para salir del país, ¿es un derecho?', 1, 4114),
