(1461, 'Una especie sin tanto valor humano\r\nLa guacamaya Ara Macao es una de las aves que están en peligro de extinción, esta especie habita principalmente en América Central, en bosques con situación climatológica cálida. Esta ave puede vivir y volar desde el nivel del mar hasta los 500 msnm, se dice que esta ave demuestra comportamiento territorial en la\r\nincubación de sus huevos y este periodo dura de 25 a 30 días.\r\nLa situación actual de esta especie es alarmante, ya que por las deforestaciones de los bosques tropicales que existían en los estados de Veracruz, Tabasco y Oaxaca, el Ara Macao ha venido disminuyendo su vida reproductiva y es muy difícil ya encontrarla por estas zonas, se dice que su máxima vida reproductiva de esta ave fue en el año 1954.\r\n¿Si la guacamaya viaja a 257 msnm qué % de altura límite está alcanzando?', 1, 4114),
