(1620, 'Al estar ahí revisó el primer tema llamado “Conquista de Mejico”, donde leyó que el 13 de agosto de 1521 la ciudad de México cayó en poder de los conquistadores españoles, al continuar su lectura descubrió que Cortéz llego a Quiahhuiztla y Cempoala en unos de sus viajes, Omar se dio cuenta que su estado Veracruz\r\nhabía sido uno de los lugares importantes para la Conquista de México después de terminar de leer este último tema se marchó a su casa porque ya eran las 6:00 pm y la biblioteca debía de cerrar. \r\n¿A qué estado pertenecen los pueblos Quiahhuiztla y Cempoala que son punto clave para la conquista de Cortés?', 1, 4114),
(1621, 'Para cuando Raúl estuvo en el Ángel de la Independencia encontró a unos jóvenes rayando una de las paredes, en la base de la estructura, lo cual le fue molesto.\r\nLa acción que vio Raúl a su llegada, ¿lo consideran ético?', 1, 4114),
(1622, 'Raúl cuenta con 5 días para poder conocer todos estos\r\ncentros turísticos, así mismo con una cantidad de mil dólares, lo cual tiene que cambiar a pesos mexicanos. La distancia que recorrerá en avión es de 1295 km (línea recta) con una duración de 1 horas, 36 minutos el vuelo. Al llegar al aeropuerto de la ciudad de México, Raúl se pudo percatar que un joven estaba robando en la tienda de souvenirs, lo cual le causó cierta incertidumbre. \r\n¿Cuántas horas duró el vuelo de Raúl Ramírez?', 1, 4114),
(1623, 'El primer día Raúl visitó el museo del templo mayor, edificio religioso más importante de Tenochtitlan, dedicado a Huitzilopochtli, Dios Solar de la guerra, y a Tláloc el Dios de la Lluvia. \r\n¿Qué civilización habitó el Templo Mayor?', 1, 4114),
(1624, ' En la visita al castillo de Chapultepec Raúl dio un paseo previo por el bosque, donde se percató que el ecosistema era completamente distinto al de su lugar de origen, contaba con las características de\r\nun bosque templado por la diversidad de flora que cuenta, entre ellos hay 42 especies vegetales que son cedros, sequoias, álamos, palmeras, ailes, pinos, gingkos, sicomoro, liquidámbar. Llegando al castillo de Chapultepec, Raúl encontró una frase que decía: Welcome to Chapultepec Castle. Para el día siguiente estuvo presente en el museo Soumaya, allí pudo encontrar diferentes obras de arte de diferentes partes del mundo. Grecia, Italia, España, Inglaterra, etc. eran esos países quienes compartieron sus obras de arte para ser expuestas en el museo. \r\n¿De qué continente eran provenientes las obras presentadas en el museo Soumaya?\r\n', 1, 4114),
