(1628, 'El entrenamiento del equipo “B” era realizado en un terreno de forma triangular con una esquina de 90°, mientras que el equipo “B” contaba con tres espacios de forma cuadrada, pentagonal y hexagonal. Los arqueros fueron analizados para poder conocer la distancia del despeje máximo. Geométricamente hablando esa parábola forma parte de lugares geométricos. \r\nLos dos puntos que tomaban de referencia para medir el despeje máximo forman una:', 1, 4114),
(1629, 'Los jugadores formaban equipos para hacer ejercicio\r\nde pases cortos, al tomar a los jugadores como puntos de referencia formaban vértices, ángulos, diagonales y lados.\r\n¿Qué figura formaban los jugadores en los ejercicios de pases cortos?', 1, 4114),
(1630, ' En 1791 Jenner decidió probar sistemáticamente la observación, que posteriormente formaría la base de una aplicación práctica a favor de la infección por viruela vacuna. Jenner raspó material de una llaga de viruela vacuna de la mano de una lechera y lo aplicó al brazo de James Phipps, el hijo de ocho años del jardinero de Jenner. El joven Phipps se sintió mal durante varios días, pero se\r\nrecuperó totalmente.\r\n¿Cuál fue la observación general que aplicó Jenner en su estudio?', 1, 4114),
(1631, 'Poco tiempo después, Jenner raspó material de una llaga fresca de viruela humana, y lo aplicó nuevamente al brazo de Phipps, como un in tento para que contrajera la viruela. Sin embargo, Phipps no contrajo la enfermedad. Por lo tanto,Jenner continuó probando su idea en otros humanos, y publicó un informe con sus descubrimientos. Ahora sabemos que el virus que ocasiona la viruela vacuna\r\npertenece a la familia de virus Orthopox, que incluyen también a los virus variola, que provocan la viruela humana.\r\nEl método de vacunación que empleó Jenner contra la viruela se hizo muy popular y finalmente se propagó por todo el mundo. Aproximadamente 150 años después\r\nde la muerte de Jenner, en 1823, la viruela se encontraba en sus últimas fases.\r\nFinalmente, en 1980 la Organización Mundial de la Salud declaró erradicada la viruela humana del planeta, después de un programa masivo de supervisión y\r\nvacunación.\r\n¿Qué método fue aplicado por Jenner para resolver esta problemática?', 1, 4114),
(1632, 'Por lo contrario, la viruela humana era una enfermedad mortal para las personas; morían aproximadamente un 30% de los infectados, y, a menudo, a los sobrevivientes los afectaba esta seria enfermedad dejándoles cicatrices profundas en la cara y en otras partes del cuerpo.\r\nSi las personas con esta enfermedad fueran 2300, ¿qué cantidad representaría a las personas que mueren por la infección?\r\n', 1, 4114),
(1633, 'Todas las vacunas creadas desde la época de Jenner surgen de su trabajo. La viruela vacuna es una enfermedad poco común en el ganado, es normalmente\r\nleve y se puede contagiar de una vaca a un humano por medio de llagas localizadas en las ubres de la vaca.\r\n¿Cuál es la clasificación alimentaria de los animales mencionados en el texto?', 1, 4114),
(1634, 'Teniendo este conocimiento y preocupado por esta situación, el alumno Jaime decidió actuar ante esta amarga noticia, él cambió su medio de transporte para evitar el daño ambiental causado por los gases que son expuestos por los vehículos de gasolina, para esto recurrió a una empresa de bicicletas ecológicas, de igual manera Jaime fomentó estos valores y les comentó a sus compañeros el bien que le proporcionarían al Planeta Tierra. \r\n¿Qué valor fomentó Jaime al invitar a sus compañeros?\r\n', 1, 4114),
(1635, ' Esta información fue presentada en la ciudad de Los Mochis por la maestra de geografía y ecología de la escuela preparatoria #57 con dirección de calle margaritas número 57 colonia centro, donde mencionó este gran problema\r\nexistente.\r\nConsiderando la ciudad en la que fue presentada esta información menciona:\r\n¿a qué estado pertenece?\r\n', 1, 4114),
(1636, 'Los Mochis por la maestra de .geografía y ecología de la escuela preparatoria #57 con dirección de calle\r\nmargaritas número 57 colonia centro, donde mencionó este gran problema\r\n ¿Cuál es la correcta sintaxis en inglés de la dirección de la escuela preparatoria?\r\n', 1, 4114),
(1637, 'Los Mochis por la maestra de .geografía y ecología de la escuela preparatoria #57 con dirección de calle\r\nmargaritas número 57 colonia centro, donde mencionó este gran problema\r\n ¿Cuál es la correcta sintaxis en inglés de la dirección de la escuela preparatoria?\r\n', 1, 4114),
(1638, 'El CO2 no sólo calienta la atmósfera, sino que también modifica la composición del aire. Si la contaminación por carbono aumenta a 1.000 partículas por millón (ppm) en 2100, las capacidades cognitivas humanas caerán un 21%, advierten los científicos.\r\nSi partiéramos desde cero, ¿Cuántas partículas por millón existirían del año en curso al 2100?', 1, 4114),
(1639, 'Menciona al país que será uno de los primeros afectados ante el deshielo causado por el calentamiento global:\r\n', 1, 4114),
(1640, '¿Cómo se llama el cambio de posición que realizará Jaime en su bicicleta desde su casa hasta el punto donde decida descansar?\r\n', 1, 4114),
(1641, 'Pasaron 50 años después de la Revolución Mexicana para que empresas ingresaran a México y es ahí cuando la contaminación tuvo su gran auge, las sequías tienen un efecto social añadido: la inestabilidad social que conduce a la guerra.\r\n¿En qué año comenzó la gran contaminación en la ciudad de México por el crecimiento industrial? ', 1, 4114),
(1642, 'Respecto a otros países, México descendió a la posición 10 de 18 países de la región que son evaluados de acuerdo con su índice de democracia. Se observan mejores números en democracia ciudadana e institucional, pero hay un índice negativo en referencia la democracia social, relacionadas al desempleo, la escolaridad y el acceso a la salud. Esta situación se hace sentir en los mexicanos, que parecen estar cada vez más desconformes y desconfiados frente al sistema.\r\n Si en un año México descendió del puesto 15 al puesto 10, ¿Cuántos años le faltarían para llegar al puesto número 2 de acuerdo con el índice de democracia?', 1, 4114),
(1643, 'Entre los estados con mayor reprobación se encuentran Guerrero, Puebla, Oaxaca, Querétaro y los mejor posicionados en cuanto a los indicadores democráticos son Yucatán, Hidalgo, Ciudad de México, Aguascalientes y Colima.\r\n How many states are mentioned in the text?\r\n', 1, 4114),
(1644, 'Mesoamérica, un espacio cultural Rossend ROVIRA MORGADO Doctorando en el Departamento de Historia de América II (Antropología de América) Universidad Complutense de Madrid.\r\nMiembro del Proyecto de Investigaciones Arqueológicas La Ventilla 2006-2008(Teotihuacan) Como argumentaba ya hace algunos años, 100 para ser exactos Claude Lévi - Strauss, el hombre suele utilizar herramientas conceptuales para comprender y analizar la realidad tangible que le rodea. De esta manera, la investigación de un mecanismo mental tan primario con el que aprender la realidad se convierte en un reto muy importante para el desarrollo de las ciencias sociales. Un buen ejemplo para entender la evolución conceptual entorno a un atractivo espacio cultural lo constituye Mesoamérica.\r\n ¿A qué tipo de artículo se refiere este texto?', 1, 4114),
(1645, '¿Qué tipo de movimiento ocupaban los mayas para concebir el tiempo mediante la puesta de sol?', 1, 4114),
(1646, 'Como argumentaba ya hace algunos años, 100 para ser exactos Claude Lévi - Strauss, el hombre suele utilizar herramientas conceptuales para comprender y analizar la realidad tangible que le rodea. De esta manera, la investigación de un mecanismo mental tan primario con el que aprender la realidad se convierte en un reto muy importante para el desarrollo de las ciencias sociales.\r\n ¿De qué año exactamente habla el texto donde el hombre utiliza herramientas para comprender y analizar la realidad?', 1, 4114),
(1647, 'Fue la mejor técnica de comunicación en estas culturas Mesoamericanas y este ha venido evolucionando conforme el paso del tiempo:', 1, 4114),
(1648, '“A los niños, desde que entran a la escuela se les debe enseñar qué alimentos comer y en qué cantidad, además de higiene, cuidados personales y cómo lavar ciertos alimentos que pueden estar contaminados; aspectos que se enseñan en la actualidad, pero no con la intensidad necesaria”, afirmó el doctor Méndez Blanco el 5 de febrero en la Agencia Informativa Conacyt.\r\n¿Qué acontecimiento se celebra en la misma fecha que el Dr. Méndez afirmo los aspectos en el Conacyt?', 1, 4114),
(1649, 'Una enfermedad silenciosa\r\nLa obesidad actualmente es considerada una epidemia en México. Entre los principales problemas identificados para que la población lleve una dieta adecuada se destaca que no hay recursos económicos suficientes para mantenerla, no se sabe cómo preparar los alimentos o no hay un gusto por consumir frutas y verduras, lo que son puntos muy importantes que deben ser tomados en cuenta para la adecuada solución de este problema de salud pública, consideró Tijerina Walls.\r\nThis text is:', 1, 4114),
(1650, 'Un día en la vida de Juan\r\nJuan es un joven de 17 años, en su colegio le solicitaron realizar un resumen del libro “100 años de soledad” de Gabriel García Márquez, por lo que debe utilizar una técnica de redacción apropiada, posterior a ello deberá realizar un parafraseo del texto “El principito” de Antaine de Saint-Exupéry. Estas dos actividades valen el 35% de calificación final en la asignatura de español, siendo 145 puntos el 100% del curso. La maestra de Juan decidió llevarlos al museo de “La ciudad de las ciencias” en donde conocerá los conceptos básicos de los números y operaciones matemáticas, razones y proporciones, ángulos y triángulos, propiedades de polígonos, de la misma manera al terminar el recorrido deberán  realizar un ensayo de los elementos de la circunferencia, segmentos rectilíneos y polígonos. Si Juan cumple con todo lo anterior, obtendrá 64 puntos de los 100 posibles en la asignatura de matemáticas.\r\n¿A cuántos puntos equivale el 35% mencionado en el párrafo uno?', 1, 4114),
(1651, '¿A qué estado pertenece la ciudad de Salina Cruz?', 1, 4114),
(1652, '¿A qué porcentaje equivalen los 64 puntos de los 100 posibles?', 1, 4114),
(1653, 'Mientras tanto Juan durante el receso, encontró una billetera con suficiente dinero en su interior, pero de igual manera dentro tenía el nombre del propietario, el amigo de Juan lo persuadía para que no devolviera el dinero, le ofreció que se lo quedaran para comprar muchas golosinas. Él no accedió y fue en busca del propietario, esto le causó una gran satisfacción personal, esto representa una de las tantas emociones que una persona puede llegar a sentir.\r\nEn el cuarto párrafo ¿Qué valores están presentes en la acción que Juan realizó con la billetera que se encontró?\r\n', 1, 4114),
(1654, 'Mientras tanto Juan durante el receso, encontró una billetera con suficiente dinero en su interior, pero de igual manera dentro tenía el nombre del propietario, el amigo de Juan lo persuadía para que no devolviera el dinero, le ofreció que se lo quedaran para comprar muchas golosinas.\r\n¿Qué antivalor reflejó el amigo de Juan?\r\n', 1, 4114),
(1655, 'Juan es un joven de 17 años, en su colegio le solicitaron realizar un resumen del libro “100 años de soledad” de Gabriel García Márquez, por lo que debe utilizar una técnica de redacción apropiada, posterior a ello deberá realizar un parafraseo del texto “El principito” de Antaine de Saint-Exupéry. Estas dos actividades valen el 35% de calificación final en la asignatura de español, siendo 145 puntos el 100% del curso. La maestra de Juan decidió llevarlos al museo de “La ciudad de las ciencias” en donde conocerá los conceptos básicos de los números y operaciones matemáticas, razones y proporciones, ángulos y triángulos, propiedades de polígonos, de la misma manera al terminar el recorrido deberán realizar un ensayo de los elementos de la circunferencia, segmentos rectilíneos y polígonos. Si Juan cumple con todo lo anterior, obtendrá 64 puntos de los 100 posibles en la asignatura de matemáticas.\r\nJuan tiene un hermano llamado Oscar que cursa el bachillerato, en su clase de Historia Univ', 1, 4114),
(1656, ' Al llegar al campo deportivo escuchamos que dos\r\nentrenadores platicaban sobre las exposiciones que tenían que planear a los padres de familia sobre el tema “adolecencia”. Al parecer los profesores tenían que cubrir ciertos requisitos, como: investigar algunas fuentes bibliográficas para argumentar su tema, aplicando mapas conceptuales para organizar la información y desarrollar algún organizador gráfico para el análisis de su exposición.\r\nDe acuerdo con la conversación de los entrenadores ¿Qué palabra se encuentra escrita incorrectamente?', 1, 4114),
(1657, 'La fábrica de zapatos “LA MEJOR” le asignan la elaboración de zapatos tenis para el evento deportivo Nacional en el que participarán 2000 deportistas. La fábrica comisiona a uno de sus empleados para que investigue cuántos pares de zapatos deberán elaborarse de cada medida. El empleado, ante la imposibilidad de tomar la medida selecciona al azar 50 deportistas a los cuales les midió el pie y con base a los datos obtenidos determinará cuántos pares de tenis deberán fabricarse para cada medida.\r\nEn términos estadísticos los 2000 alumnos corresponden a:\r\n', 1, 4114),
(1658, 'La fábrica de zapatos “LA MEJOR” le asignan la elaboración de zapatos tenis para el evento deportivo Nacional en el que participarán 2000 deportistas. La fábrica comisiona a uno de sus empleados para que investigue cuántos pares de zapatos deberán elaborarse de cada medida. El empleado, ante la imposibilidad de tomar la medida selecciona al azar 50 deportistas a los cuales les midió el pie y con base a los datos obtenidos determinará cuántos pares de tenis deberán fabricarse para cada medida.\r\nLos 50 alumnos corresponden a:\r\n', 1, 4114),
(1659, 'El empleado, ante la imposibilidad de tomar la medida selecciona al azar 50 deportistas a los cuales les midió el pie y con base a los datos obtenidos determinará cuántos pares de tenis deberán fabricarse para cada medida.\r\nEl tamaño del pie de los alumnos corresponde a:\r\n', 1, 4114),
(1660, 'Carlos, la tía Alejandra y Alicia hicieron un total de 20 sándwiches para comer los próximos días que iban a estar juntos. La tía Alejandra hizo 3 veces más que Carlos y Alicia hizo el doble que la tía Alejandra\r\n ¿Cuántos sándwiches hizo Alicia?', 1, 4114),
(1661, 'Los fines de semana por lo regular la tía Alejandra, aprovecha después de una semana de trabajo, a limpiar su casa. Este sábado fui a visitarla y me asignó junto con mi prima Alicia algunas actividades de limpieza. Alicia tomó el detergente para lavar ropa, la tía Alejandra le indicó que debería clasificar la ropa por su textura, (esto me recordó a la clase de química que llevo en el bachillerato) ¿Cómo debía clasificar la ropa Alicia?', 1, 4114),
(1662, 'En lo que nosotros realizábamos nuestras actividades la tía fue al mercado para preparar la comida, iba con la intención de comprar pescado para freír, pero nos platicó que no era conveniente porque les avisaron que había “Mareas Rojas” y prefirió preparar comida italiana, que sabe que nos gusta mucho, además, que es menos gasto, pues la situación económica, aunque se pueda trabajar, no es suficiente para darse algunos gustos.\r\n¿Qué tipo de comida preparó la tía Alejandra?', 1, 4114),
(1393, '¿Con cuántos pesos mexicanos contaba Raúl si el dólar está \r\nen 18 a la venta?', 1, 4114),
(1394, '¿A qué velocidad viajó el avión de Raúl? ', 1, 4114),
(1395, 'La acción que vio Raúl en el aeropuerto a su llegada, ¿lo \r\nconsideran ético?', 1, 4114),
(1396, '¿Cuántas horas duró el vuelo de Raúl Ramírez?', 1, 4114),
(1397, '¿Qué civilización habitó el Templo Mayor? ', 1, 4114),
(1405, '¿De qué continente eran provenientes las obras \r\npresentadas en el museo Soumaya?', 1, 4114),
(1411, 'Tipo de triángulo donde se llevaba a cabo el entrenamiento:', 1, 4114),
(1412, 'Los tres espacios de forma cuadrada, pentagonal y \r\nhexagonal donde entrenaba el equipo “B” forman parte de \r\nlos:\r\n', 1, 4114),
(1413, 'La parábola encontrada en estudio forma parte de:', 1, 4114),
(1414, 'Los dos puntos que tomaban de referencia para medir el \r\ndespeje máximo forman una:', 1, 4114),
(1415, '¿Qué figura formaban los jugadores en los ejercicios de \r\npases cortos?', 1, 4114);
